import axios from "axios";
import store from "../../index";
import alliances from "../../reducers/alliances";

const addTeamToAllianceApi = async (team, alliance) => {
  console.log(team);
  console.log(alliance);
  const team_url = `http://cms.avertra.com/teams/${team.id}`;
  console.log(store.getState().token, "Tokennnnnnnnn");
  console.log(team_url);
  const headers = {
    Authorization: "Bearer " + store.getState().token,
    "Content-Type": "application/json",
  };
  const data = JSON.stringify({
    alliance: alliance.id,
  });
  console.log(data, "333333333");

  try {
    const resp = await axios.put(team_url, {
      headers: headers,
      data: data,
    });
    console.log(resp.data, "aaaaaaaaaaadata");
  } catch (err) {
    console.error(err);
  }
};
export { addTeamToAllianceApi };
